import './Left.css';

const AboutUs = () => (
  <div>About Us</div>
)

const Login = () => (
  <div>Login</div>
)

function Left() {
  return (
    <div className="Left">
      <AboutUs />
      <Login />
    </div>
  );
}

export default Left;
